CREATE DEFINER=`mm_cpsc502101team05`@`%` PROCEDURE `nutriCheck`(calMin INT, calMax INT,
carbMin INT, carbMax INT, protMin INT, protMax INT, fatMin INT, fatMax INT)
BEGIN
SELECT food_name AS FoodName, nutr_calories as Calories, nutr_carbohydrates_g as Carbs, nutr_protein_g as Protein, nutr_fat_g as Fat
FROM food f JOIN nutrition n on f.nutr_id = n.nutr_id
